import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/">
              <h1>Home</h1>
            </Link>
          </li>
          <li>
            <Link to="/about">
              <h1>About</h1>
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
